import React from 'react'
import trelloLogo from "../trello-logo/trello-logo-blue.png"
function SignUp() {
    return (
    <>
        <img className="trellopng" src={trelloLogo}/>
        <Form></Form>
        </>
    )
}

function Form() {
   return (
   <form id="signupF">
        <input placeholder="email"/>
   </form>
   )
}

export default SignUp
